import { Component } from '@angular/core';
import { colourTemplate, colours } from '../Interfaces/colours';
import { fonts, fontsTemplate } from '../Interfaces/fonts';

@Component({
    selector: 'app-pop-up',
    templateUrl: './pop-up.component.html',
    styleUrls: ['./pop-up.component.css']
})
export class PopUpComponent {
    colours: colourTemplate = colours;
	fonts: fontsTemplate = fonts;
}
<div class="blur">
    <div 
        class="container"
        [style.background]="colours.background1"
        [style.font-family]="fonts.font3"
        [style.color]="colours.font3"
    >
        <img src="assets/Img1.jpg" class="img">
    </div>
</div>
